    "2016-07-27T22:21:33.563603",nt"name": "modoc-national-wildlife-refuge-wildlife-and-habitat-management-review-june-30-to-july-3-20",nt"isopen":
    false,nt"url": null,nt"notes": "This report summarizes the findings and
    recommendations from an evaluation of the wildlife and habitat management program
    conducted by a review team during June 30 -July 3, 2003 at Modoc National Wildlife
    Refuge (MNWR). Its purposes were the following: 1) determine if the wildlife and
    habitat  management program supports refuge purposes as well as the Improvement
    Act and Service policies regarding fish and wildlife management; 2) identify short-
    and long-term visions for habitat and wildlife management; 3) identify measures,
    if needed, that would improve wildlife and habitat management as  well as contribute
    to ecological integrity of the System from local, regional, ecosystem, and national
    scales; 4) identify monitoring needs required to implement adaptive management;
    and 5) identify staffing/equipment needs required to optimize management to accomplish/address
    the highest biological  and habitat management recommendations. The following recommendations
    were formulated by the core review team members (Appendix) during the site visit.
    These recommendations considered input provided by the extended team during the
    field tour portion of the review.",nt"license_title": "License Not Specified",nt"extras":
